function Image_Box() {
    return (
        <div id="slideShow">
            <div id="slides">
                <img src={Img1} alt=""/>

                <button id="prev">&lang;</button>
                <button id="next">&rang;</button>
            </div>
        </div>
    );
}

export default Image_Box;
